//import React, so I can use JSX
import React from 'react';

//create Card app
const Card = ({id, name, username, email}) => {
	return (
		<div>
			<img alt='robots' src={`https://robohash.org/${username}?set=set4`} height='200' width='200'/>
			<div>
				<h1>{name}</h1>
				<p>{email}</p>
			</div>
		</div>
		)
}

export default Card;
